pull_request.body:
Some code refactoring with the help of Android Studio.

Most of the time from:
```java
} else if (value instanceof List) {
  List list = (List) value;
}
```

to
```java
} else if (value instanceof List list) {
```

Some missing permission checks.

No functional changes. Tested it with Kitchensink, Hyperloop-examples, another app and the test suite.
